import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.bundle.min.js';
import 'bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';
import $ from 'jquery';
import Popper from 'popper.js';
import './App.css';
import {
    LineChart,
    ResponsiveContainer,
    Legend, Tooltip,
    Line,
    XAxis,
    YAxis,
    CartesianGrid
} from 'recharts';

// Sample chart data
const pdata = [

    {
        time: '09:15',
        premium: 120
    },
    {
        time: '09:16',
        premium: 12
    },
    {
        time: '09:17',
        premium: 10
    },
    {
        time: '09:18',
        premium: 5
    },
    {
        time: '09:19',
        premium: 4
    },
    {
        time: '09:20',
        premium: 8
    },
];




function App() {
  return (
    <div className="Main">
        <nav class="navbar sticky-top navbar-light bg-light">
            <div class="navbar-header">
              <a class="navbar-brand" href="#"> My OI World</a>
            </div>
            <div class="d-flex flex-row">
              <button class="btn btn-success navbar-btn me-1" value="Strategy Builder" >Strategy Builder</button>
              <button class="btn btn-success navbar-btn me-1" value="Open Interest" >Open Interest</button>
              <button class="btn btn-success navbar-btn me-1" value="Straddle Charts" >Straddle Charts</button>
              <div class="btn-group">
                  <button type="button" class="btn btn-secondary dropdown-toggle" data-bs-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                  Username
                  </button>
                  <div class="dropdown-menu dropdown-menu-end" style={{marginTop : "8px"}}>
                    <button class="dropdown-item" type="button">My Profile</button>
                    <button class="dropdown-item" type="button">Logout</button>
                  </div>
               </div>
            </div>
          </nav>

       <div>
            <h1 className="text-heading">
                Line Chart Using Rechart
            </h1>
            <ResponsiveContainer width="70%" aspect={3}>
                <LineChart data={pdata} margin={{ right: 300 }}>
                    <CartesianGrid />
                    <XAxis dataKey="time"
                        interval={'preserveStartEnd'} />
                    <YAxis></YAxis>
                    <Legend />
                    <Tooltip />
                    <Line dataKey="premium"
                        stroke="red" activeDot={{ r: 8 }} />
                </LineChart>
            </ResponsiveContainer>
        </div>
    </div>
  );
}

export default App;
